// import React from 'react';
import { Card, CardActions, CardContent, CardMedia, Button, Typography } from '@material-ui/core';
// import ThumbUpAltIcon from '@material-ui/icons/ThumbUpAlt';
import AddIcon from '@mui/icons-material/Add';
import UpdateIcon from '@mui/icons-material/Update';
import RemoveIcon from '@mui/icons-material/Remove';
import DeleteIcon from '@material-ui/icons/Delete';
import CheckIcon from '@mui/icons-material/Check';
import MoreHorizIcon from '@material-ui/icons/MoreHoriz';
import moment from 'moment';
import { useDispatch } from 'react-redux';

import { deleteMeal, addMeal, removeMeal } from '../../../actions/menu';
import {deleteTable, checkoutTable} from '../../../actions/tables';

import useStyles from './styles';

import getTables from '../../../actions/tables';

import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

import React, { useState, useEffect } from 'react';
import  Axios  from 'axios';

const TableEach = ({ tid, setTidCreate, setOidUpdate }) => {
    const classes = useStyles();
    const dispatch = useDispatch();

    const [TablesList, setTablesList] = useState([]);


    const [tableData, setTableData] = useState({ meal_id: 1, meal_name: 'Pasta', table_id: 1, price: 0, quantity: 0 });
    const dispatchTables = useDispatch();

    Axios.get('http://localhost:3002', {
        params: {
            tid: tid,
        },
    }).then((response) => {
        setTablesList(response.data);
    });

    return (
        <TableContainer component={Paper}>
            {/* <Table className= {classes.tableSingle} sx={{ minWidth: 650 }} aria-label="simple table" > */}
            <Table className={classes.tableSingle}  >
                <TableHead>
                {/* <TableRow >Table{tid}</TableRow> */}
                <TableRow ><Typography className={classes.tablerow}>Table{tid}</Typography></TableRow>
                <TableRow>
                    <TableCell align="right" size='small'>order_id</TableCell>
                    <TableCell align="right" size='small'>meal_id</TableCell>
                    <TableCell align="right" size='small'>meal_name</TableCell>
                    <TableCell align="right" size='small'>table_id</TableCell>
                    <TableCell align="right" size='small'>price</TableCell>
                    <TableCell align="right" size='small'>quantity</TableCell>
                    <TableCell align='right' size='small'>
                        {/* <Button size="small" color="primary" onClick={() => setTidCreate(tid)}>
                            <AddIcon fontSize="small"/>
                                Add 
                        </Button> */}
                        {/* <Button size="small" color="primary" > */}
                        <Button size="small" color="primary" onClick={() => dispatchTables(checkoutTable(tid))}>
                            <CheckIcon fontSize="small"/>
                                Checkout
                        </Button>
                    </TableCell>
                </TableRow>
                </TableHead>
                <TableBody>
                {TablesList.map((order) => (
                    <TableRow
                    key={order.id}
                    sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                    >
                    <TableCell align="right" size='small'>{order.order_id}</TableCell>
                    <TableCell align="right" size='small'>{order.meal_id}</TableCell>
                    <TableCell align="right" size='small'>{order.meal_name}</TableCell>
                    <TableCell align="right" size='small'>{order.table_id}</TableCell>
                    <TableCell align="right" size='small'>{order.price}</TableCell>
                    <TableCell align="right" size='small'>{order.amount}</TableCell>
                    <TableCell align='right' size='small'>
                        {/* <Button size="small" color="primary">
                            <UpdateIcon fontSize="small" onClick={() => {
                                                                        setOidUpdate(order.order_id)
                                                                        console.log('order_id is ' + order.order_id)}}
                                                                        />
                                Update
                        </Button> */}
                        <Button size="small" color="primary" onClick={() => dispatchTables(deleteTable(order.order_id))}>
                            <DeleteIcon fontSize="small"/>
                                Delete
                        </Button>
                    </TableCell>
                    </TableRow>
                ))}
                </TableBody>
            </Table>
    </TableContainer>
    );
}

export default TableEach;
